func exitReasonBadge(reason string) string {
	switch reason {
	case "exit":
		return "badge-green"
	case "clear":
		return "badge-yellow"
	default:
		return "badge-gray"
	}
}

func agentKindBadge(kind string) string {
	switch kind {
	case "task":
		return "badge-blue"
	case "skill":
		return "badge-yellow"
	default:
		return "badge-gray"
	}
}

func opBadge(op string) string {
	switch op {
	case "read":
		return "badge-blue"
	case "write":
		return "badge-green"
	case "edit":
		return "badge-yellow"
	default:
		return "badge-gray"
	}
}

func formatDuration(seconds int64) string {
	if seconds == 0 {
		return "-"
	}
	if seconds < 60 {
		return fmt.Sprintf("%ds", seconds)
	}
	return fmt.Sprintf("%dm %ds", seconds/60, seconds%60)
}

